import React, { Component } from 'react';
// import { NavLink } from 'react-router-dom';

import '../../css/Home.css';

import Link from '../presentational/Link';

import bg from '../../img/home/bg.png';
import man from '../../img/home/man.png';
import woman from '../../img/home/woman.png';
import dog from '../../img/home/dog.png';

const manMobile = 'https://s3.amazonaws.com/yapjinai/home/man-mobile.png';
const womanMobile = 'https://s3.amazonaws.com/yapjinai/home/woman-mobile.png';
const dogMobile = 'https://s3.amazonaws.com/yapjinai/home/dog-mobile.png';

class Home extends Component {

  render() {
    return (
      <>
        <div className="Home">
          <img
            id='bg'
            src={bg}
            alt='bg'
          />
          {this.renderLinks()}
        </div>
        <div className="Home-mobile">
          {this.renderMobileLinks()}
        </div>
      </>
    );
  }

  /////////////////

  renderLinks = () => {
    const links = [
      {
        name: 'man',
        image: man,
        page: 'visual'
      },
      {
        name: 'woman',
        image: woman,
        page: 'music'
      },
      {
        name: 'dog',
        image: dog,
        page: 'web'
      },
    ]

    return links.map(link => {
      return <Link link={link} key={link.name} />
    })
  }

  renderMobileLinks = () => {
    const links = [
      {
        name: 'man-mobile',
        image: man-mobile,
        page: 'visual'
      },
      {
        name: 'woman-mobile',
        image: woman-mobile,
        page: 'music'
      },
      {
        name: 'dog-mobile',
        image: dog-mobile,
        page: 'web'
      },
    ]

    return links.map(link => {
      return <Link link={link} key={link.name} />
    })
  }
}

export default Home;
